import React from 'react';
import ReactDOM from 'react-dom/client';
import AppRoute from './Promise_Routing/AppRoute';
import { Provider } from 'react-redux';

import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter,Route, Routes } from 'react-router-dom';
import DeliveryDetails from './Component/DeliveryDetails';
//import './custom.scss';

export default function AppForRoutes()
{
  return(

    <BrowserRouter>
              <Routes>
                  <Route path="/" >
                  <Route path="delivery/details" element={<DeliveryDetails></DeliveryDetails>}></Route>

                  </Route>
              </Routes>

    </BrowserRouter>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

